import React from 'react';

import logo from '../images/logo.svg';
import { Row, Col, Image } from 'react-bootstrap';

const Main = () => {
  return (
    <Row>
      <Col>
        <Image src={logo} alt='logo' />
      </Col>
    </Row>
  );
};

export default Main;
